  \"Microtine rodents and ground squirrels of the coastal plain and foothills of the
  Arctic National Wildlife Refuge: Distribution, densities, and general ecology\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 8,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T23:02:07.585379\",\n\t\"name\": \"microtine-rodents-and-ground-squirrels-of-the-coastal-plain-and-foothills-of-the-arctic-na\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"A microtine rodent trapping survey was
  done at 3 locations across an altitude/coastal influence gradient in the Arctic
  National Wildlife Refuge from 2 June - 18 August 1982. Each location was trapped
  3 times, at monthly intervals. Microtus oeconomus decreased in density and Dicrostonyx
  torquatus and Lemmus sibericus increased towards the coast. Microtus miurus occurred
  only at the most inland site. The coastal microtines appeared to be at a low point
  in their cyclic fluctuation. Arctic ground squirrels (Spermophilus parryii) were
  also surveyed at the same locations. Density distributions of S. parryii depends
  primarily on suitable burrowing conditions and forage quality. Herbivory by, and
  predator use of microtines and ground squirrels suggests their integral importance
  in the Arctic ecosystem.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
